(167, 'theme_mods_skt-construction-lite', 'a:22:{s:18:\"custom_css_post_id\";i:-1;s:12:\"color_scheme\";s:7:\"#1c1ea5\";s:11:\"head_number\";s:14:\"+2349034066870\";s:10:\"head_email\";s:25:\"info@prissolutions.com.ng\";s:12:\"head_address\";s:6:\"FUNAAB\";s:16:\"head_citycountry\";s:8:\"Abeokuta\";s:7:\"fb_link\";s:0:\"\";s:10:\"twitt_link\";s:0:\"\";s:10:\"gplus_link\";s:0:\"\";s:11:\"linked_link\";s:0:\"\";s:11:\"about_title\";s:10:\"WHAT WE DO\";s:17:\"about_description\";s:602:\"We work hand in hand with our partners to provide web development, software installation, software upgrade and system repairs services to our clients.\n\nAnd for FUNAAB students, you sure don\'t want to be walking about looking for apartments especially as a Fresher. We have therefore made it our duty to do that for you. Take a seat, grab a cup of coffee and slide through our galleries, select your most wanted apartment and have a direct contact with the agents, easy!\nOur main objective is to connect you to the agent of the apartment you have selected and it\'s for all, FRESHERS and OLD STUDENTS.   \";s:16:\"recentpost_title\";s:5:\"POSTS\";s:13:\"contact_title\";s:10:\"Contact Us\";s:11:\"contact_add\";s:263:\"Agents that require our services should also contact us through the same details below to know the pros and cons. Don\'t you want to get that computer issue fixed? We are just a phone call away.                           :  \n             \nOluwokeesin, Alabata Road\";s:10:\"contact_no\";s:21:\"Phone: +2349034066870\";s:12:\"contact_mail\";s:25:\"info@prissolutions.com.ng\";s:18:\"nav_menu_locations\";a:1:{s:7:\"primary\";i:4;}s:11:\"custom_logo\";i:329;s:13:\"page-setting7\";i:0;s:13:\"page-setting8\";i:0;s:13:\"page-setting9\";i:0;}', 'yes'),
