(1062, 89, '_elementor_data', '[{\"id\":\"be28209\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"cde7914\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"5d11945\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Here at \\u00a0PRISSOLUTIONS, We work hand in hand with our partners to provide web development, software installation, software upgrade and system repairs services to our clients. We also help to secure accommodations for university students, terms and conditions apply.\\u00a0<\\/p><p>Do you have a computer or does your friend have one, sooner or later there will be a need to do some repairs on it. Guess what, you don\'t always have to take it to an engineer. With adequate instructions, you might become an engineer in a day. Here you learn about your PC and you obtain ideas on how to fix PC issues. Read our different posts and you may discover what is wrong with your PC and probably fix it yourself <a href=\\\"http:\\/\\/www.prissolutions.com.ng\\\">here<\\/a>\\u00a0.<\\/p><p>Feel free to contact us if you require any of our services stated above or if you need to make any inquiry, you won\'t be disappointed.<\\/p><p>If you are student of the Federal University of Agriculture, then this is the right place for you to get your most wanted off campus apartment. We operate in different axis of the school area: <strong>GATE, OLUWO, CAMP.<\\/strong><\\/p><p>Explore our galleries with each page of it tagged with\\u00a0 the name of the area you would prefer to stay in the drop down menu above<\\/p><p><em><strong>THIS IS FUNAAB ABODE!<\\/strong><\\/em><\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"dcd5b11\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"e65819b\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"5f465ac\",\"elType\":\"widget\",\"settings\":{\"title\":\"OUR TEAM\",\"header_size\":\"h1\",