(89, 1, '2018-10-08 20:32:32', '2018-10-08 20:32:32', 'Here at PRISSOLUTIONS, We work hand in hand with our partners to provide web development, software installation, software upgrade and system repairs services to our clients. We also help to secure accommodations for university students, terms and conditions apply.\r\n\r\nDo you have a computer or does your friend have one, sooner or later there will be a need to do some repairs on it. Guess what, you don\'t always have to take it to an engineer. With adequate instructions, you might become an engineer in a day. Here you learn about your PC and you obtain ideas on how to fix PC issues. Read our different posts and you may discover what is wrong with your PC and probably fix it yourself <a href=\"http://www.prissolutions.com.ng\">here</a>.\r\n\r\nFeel free to contact us if you require any of our services stated above or if you need to make any inquiry, you won\'t be disappointed.\r\n\r\nIf you are student of the Federal University of Agriculture, then this is the right place for you to get your most wanted off campus apartment. We operate in different axis of the school area: <strong>GATE, OLUWO, CAMP.</strong>\r\n\r\nExplore our galleries with each page of it tagged with the name of the area you would prefer to stay in the drop down menu above\r\n\r\n&nbsp;\r\n<h1>OUR TEAM</h1>\r\n<figure><a href=\"http://localhost/prissolutions/wp-content/uploads/2020/05/social.jpg\" data-elementor-open-lightbox=\"default\">\r\n<img src=\"http://localhost/prissolutions/wp-content/uploads/2020/05/social-768x787.jpg\" sizes=\"(max-width: 768px) 100vw, 768px\" srcset=\"http://localhost/prissolutions/wp-content/uploads/2020/05/social-768x787.jpg 768w, http://localhost/prissolutions/wp-content/uploads/2020/05/social-293x300.jpg 293w, http://localhost/prissolutions/wp-content/uploads/2020/05/social.jpg 828w\" alt=\"\" width=\"768\" height=\"787\" /> </a><figcaption>Olubanwo Ayomide: Front End Developer</figcaption></figure>\r\n<figure><a href=\"http://localhost/prissolutions/wp-content/uploads/2020/05/lightsource.jpg\" data-elementor-open-lightbox=\"default\">\r\n<img src=\"http://localhost/prissolutions/wp-content/uploads/2020/05/lightsource.jpg\" sizes=\"(max-width: 543px) 100vw, 543px\" srcset=\"http://localhost/prissolutions/wp-content/uploads/2020/05/lightsource.jpg 543w, http://localhost/prissolutions/wp-content/uploads/2020/05/lightsource-300x262.jpg 300w\" alt=\"\" width=\"543\" height=\"475\" /> </a><figcaption>Israel Akin-Akinsanya: Manager/ Backend Developer/Engineer</figcaption></figure>\r\n<figure><a href=\"http://localhost/prissolutions/wp-content/uploads/2020/05/IMG-20200508-WA0019.jpg\" data-elementor-open-lightbox=\"default\">\r\n<img src=\"http://localhost/prissolutions/wp-content/uploads/2020/05/IMG-20200508-WA0019.jpg\" sizes=\"(max-width: 720px) 100vw, 720px\" srcset=\"http://localhost/prissolutions/wp-content/uploads/2020/05/IMG-20200508-WA0019.jpg 720w, http://localhost/prissolutions/wp-content/uploads/2020/05/IMG-20200508-WA0019-150x150.jpg 150w, http://localhost/prissolutions/wp-content/uploads/2020/05/IMG-20200508-WA0019-300x298.jpg 300w\" alt=\"\" width=\"720\" height=\"714\" /> </a><figcaption>Arowojolu Israel: Cosultant/Media Personnel</figcaption></figure>', 'About Us', '', 'publish', 'closed', 'closed', '', 'about', '', '', '2020-05-08 21:01:29', '2020-05-08 21:01:29', '', 0, 'http://localhost/funaabaccommodation/?page_id=89', 0, 'page', '', 0),
