(304, 1, '2019-05-10 13:34:49', '2019-05-10 13:34:49', 'Are you having an overheating or hot PC?\r\n\r\nHere are the possible causes and remedies:\r\n\r\nFirst, get the difference! Having a hot computer is quite different from having an overheating computer. Having a hot computer might just be normal. You might just be placing it in the wrong place, probably on your laps. WRONG! It should be on your desk. The hotness can however be reduced by\r\n<ul>\r\n 	<li>Monitoring your task manager (ctrl+shift+esc on Windows, open activity monitor on Mac).</li>\r\n 	<li>Stopping unnecessary activities. Do not stop the ones you are not sure what their uses are</li>\r\n 	<li>Staying in a cool place, an environment friendly to your computer.</li>\r\n</ul>\r\n<strong>Now the Overheating aspect</strong>\r\n\r\nYour computer is said to be overheating when it becomes too hot and shuts down frequently.\r\n<ul>\r\n 	<li>First thing to do is to check your fan. Can you feel some air coming out of the vent? You sure the fan is not enclosed in dust? If the answers to these questions is no, consider giving your fan a quick fix.</li>\r\n 	<li>If the overheating persist, it means your processor needs some food. The food we are referring to here is thermal grease. It reduces heat emitted as a result of your processor activities. This is usually technical, you might need an engineer to help you out. Remember, we are only a phone call away-<a href=\"tel:+234 813 000 5258\">08130005258</a>.</li>\r\n 	<li>If the problem persists, consider changing your processor or buying an entirely new computer.</li>\r\n</ul>', 'OVERHEATING', '', 'publish', 'open', 'open', '', 'overheating', '', '', '2019-05-11 08:36:29', '2019-05-11 08:36:29', '', 0, 'http://www.funaababode.com.ng/?p=304', 0, 'post', '', 4),
